// It's near-impossible to read relative-path gani files due to security concerns
// So we're just going to store them as base64 and decode them
function getInternalGani(ani) {
  if (ani == null) ani = "idle.gani";
  else if (!ani.endsWith(".gani")) ani = ani + ".gani";
 
  switch (ani) {
    default:
    case "default.gani": 
      return atob("");
    
    case "idle.gani":
      return atob("");
      
    case "walk.gani": 
      return atob("");
      
    case "sword.gani": 
      return atob("");

    case "carry.gani": 
      return atob("");

    case "sit.gani": 
      return atob("");

    case "mount.gani": 
      return atob("");

    case "bigmount.gani": 
      return atob("");
      
    case "2pmount.gani": 
      return atob("");

    case "grab.gani": 
      return atob("");

    case "pull.gani": 
      return atob("");
      
    // Jusst easier to copy/paste this for future additions
    case "template.gani": 
      return atob("");
  }
}